import React, { useEffect, useState } from 'react';
import { fetchMove, fetchPokemon } from './utils';
import { Pokemon, MoveObject } from './types';

//import InfoContainer from './components/InfoContainer';
import PokemonCard from './components/PokomonCard';

import './app.css';

const App = () => {
  const [pokemon, setPokemon] = useState<Pokemon>();
  const [move1, setMove1] = useState<MoveObject>();


  useEffect(() => {
    fetchPokemon('bulbasaur').then((res) => setPokemon(res));
    fetchMove('13').then((res) => setMove1(res));
  }, []);

  return (
    <div className='appRoot'>
      {/* <InfoContainer pokemon={pokemon} /> */}
      <PokemonCard pokemon={pokemon} />
    </div>
  );
};

export default App;
